import * as React from 'react';
import isWeekend from 'date-fns/isWeekend';
import TextField from '@mui/material/TextField';
import AdapterDateFns from '@mui/lab/AdapterDateFns';
import LocalizationProvider from '@mui/lab/LocalizationProvider';
import StaticDatePicker from '@mui/lab/StaticDatePicker';
import { Container, Grid } from '@mui/material';
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';
import Box from '@mui/material/Box';

export default function BookGoogleEvent() {
  const [value, setValue] = React.useState('');
  const [showTime, setShowTime] = React.useState(false);

  const buttons = [
    <Button key="10">10:00 AM</Button>,
    <Button key="11">11:00 AM</Button>,
    <Button key="12">12:00 PM</Button>,
    <Button key="13">1:00 PM</Button>,
    <Button key="14">2:00 PM</Button>,
    <Button key="15">3:00 PM</Button>,
    <Button key="16">4:00 PM</Button>,
    <Button key="17">5:00 PM</Button>,
    <Button key="18">6:00 PM</Button>
  ];

  return (
    <Container>
      <Grid container spacing={2} mb={3}>
        <Grid item xs={10}>
          <LocalizationProvider dateAdapter={AdapterDateFns}>
            <StaticDatePicker
              disablePast
              orientation="landscape"
              openTo="day"
              value={value}
              onChange={(newValue) => {
                setValue(newValue);
                setShowTime(true);
              }}
            />
          </LocalizationProvider>
        </Grid>
        {showTime ? (
          <Grid item xs={2} mt={2}>
            <ButtonGroup orientation="vertical" aria-label="vertical outlined button group">
              {buttons}
            </ButtonGroup>
          </Grid>
        ) : (
          <Container />
        )}
      </Grid>
    </Container>
  );
}
